    @gen_test
    def test_cities_all(self):
        # level1
        http_response = ObjectDict(
            ujson.loads(self.dict_level1_cities_http_response))
        c1 = self.service._make_level_1_cities_result(http_response)
        pprint(c1)
        self.assertIsInstance(c1, list)

        # level2
        http_response = ObjectDict(
            ujson.loads(self.dict_level2_cities_http_response))
        c2 = self.service._make_level_2_cities_result(http_response)
        pprint(c2)
        self.assertIsInstance(c2, list)

        # whole citi list
        result = self.service.make_cities_result(c1, c2)
        pprint(result)
        self.assertIn(
            {'list': [{'code': 152900, 'name': '阿拉善盟'},
                      {'code': 210300, 'name': '鞍山'},
                      {'code': 340800, 'name': '安庆'},
                      {'code': 410500, 'name': '安阳'},
                      {'code': 513200, 'name': '阿坝'},
                      {'code': 520400, 'name': '安顺'},
                      {'code': 542500, 'name': '阿里'},
                      {'code': 610900, 'name': '安康'},
                      {'code': 652900, 'name': '阿克苏地区'},
                      {'code': 654300, 'name': '阿勒泰'}],
             'text': 'A'}, result)

        # hot cities
        result = self.service.make_cities_result(c1, c2, hot=True)
        pprint(result)
        self.assertIn({'code': 310000, 'name': '上海'}, result)

        # get name by code
        result = self.service.make_city_code_by_name_result(c2, '珠海')
        pprint(result)
        self.assertEqual(result, 440400)
        result = self.service.make_city_code_by_name_result(c2, '我是不存在')
        pprint(result)
        self.assertEqual(result, 0)

        # get code by name
        result = self.service.make_city_name_by_code_result(c2, 440400)
        pprint(result)
        self.assertEqual(result, '珠海')
        result = self.service.make_city_name_by_code_result(c2, 1010100101001)
        pprint(result)
        self.assertEqual(result, None)

        # invalid input check
        self.service.get_city_name_by = partial(
            self.service.get_city_name_by.__wrapped__, self)
        with self.assertRaises(ValueError) as cm:
            yield self.service.get_city_name_by(None)
        self.assertEqual(cm.exception.args[0], 'invalid city_code')
        with self.assertRaises(ValueError) as cm:
            yield self.service.get_city_name_by('abc')
        self.assertEqual(cm.exception.args[0], 'invalid city_code')

        self.service.get_city_code_by = partial(
            self.service.get_city_code_by.__wrapped__, self)
        with self.assertRaises(ValueError) as cm:
            yield self.service.get_city_code_by(None)
        self.assertEqual(cm.exception.args[0], 'invalid city_name')
        with self.assertRaises(ValueError) as cm:
            yield self.service.get_city_code_by(123)
        self.assertEqual(cm.exception.args[0], 'invalid city_name')

